let obj = flow.get('data_1') || {};
let arr = flow.get("robot_1");
let cont = flow.get("count") || 0;
let robotNo = 0;
let axisNo = 0;
let tagCount = 5; // Conteo de tags que se tienen en  OPC READ
let carga = flow.get("robot_1_carga_x") || 0;
obj.id = {};
obj.id.value = 'eje1';
let value = !isNaN(msg.payload) ? msg.payload.toFixed(2) : parseFloat(msg.payload).toFixed(2);

// Desvio de información que llega al nodo a los valores correspondientes
if (msg.topic == "ns=8;s=ns=7%3Bi=5004??krlvar:/System#$CURR_ACT[1]") {
    obj.corriente = {};
    obj.corriente.value = value;
    cont++;
} else if (msg.topic == "ns=8;s=5001.Robot.PowerTrains.PTA1.Motor_1.ParameterSet.MotorTemperature") {
    obj.temperatura = {};
    obj.temperatura.value = (value-273.15).toFixed(2);
    cont++;
} else if (msg.topic == "ns=8;s=5001.Robot.Axes.A1.ParameterSet.ActualPosition") {
    obj.pos_actual = {};
    obj.pos_actual.value = value;
    cont++;
} else if (msg.topic == "ns=1;s=Isolated_Input4") {
    obj.pos_meta = {};
    obj.pos_meta.value = value;
    cont++;
} else if (msg.topic == "ns=8;s=ns=7%3Bi=5004??krlvar:/System#$TORQMON[1]") {
    obj.torque = {};
    obj.torque.value = value;
    cont++;
} else if (msg.topic == "ns=1;s=Isolated_Input6") {
    obj.torque_factor = {};
    obj.torque_factor.value = value;
    cont++;
} else if (msg.topic == "ns=1;s=Isolated_Input7") {
    obj.error = {};
    obj.error.value = value;
    cont++;
} else if (msg.topic == "ns=8;s=5001.Robot.FlangeLoad.Inertia.X") {
    carga = value;
    flow.set('robot_1_carga_x', carga);
    cont++;
}

if (cont >= tagCount) {
    arr[axisNo] = obj;
    cont = 0;
    flow.set("robot1_eje1_listo", true);
    msg.payload = obj;
} else {
    msg.payload = "";
}
flow.set('data_1', obj);
flow.set("count", cont);

return msg;

