if(receta[robot-1][eje-1] == null){
    return;
}
let count_corriente = flow.get("delay_alarma_corriente_"+robot+"_"+eje);
let alarma_corriente_habilitada = flow.get("alarma_corriente_habilitada_"+robot+"_"+eje);
let corriente = parseFloat(msg.payload.corriente.value);
let corriente_inf = parseFloat(receta[robot-1][eje-1].corriente.setpoint_min) || "";
let corriente_sup = parseFloat(receta[robot-1][eje-1].corriente.setpoint_max) || "";
let corriente_retardo = parseFloat(receta[robot-1][eje-1].corriente.retardo_alarma) || "";
let arr = flow.get("robot_"+robot);

// Si la variable esta fuera de limites y no hay alarma habilitada
if((corriente > corriente_sup || corriente < corriente_inf) && !alarma_corriente_habilitada){
    arr[eje-1].corriente.color = "red";
    if(count_corriente >= corriente_retardo){
        msg.payload = {};
        msg.payload.corriente = {};
        msg.payload.corriente.alarma = true;
        msg.payload.corriente.valor = corriente;
        msg.payload.robot = robot;
        msg.payload.nivel = 1;
        msg.payload.eje = eje;
        msg.payload.corriente.contador = count_corriente;
        if(corriente > corriente_sup){
            msg.payload.corriente.descripcion = "valor de corriente por encima de limite superior";
        }
        else{
            msg.payload.corriente.descripcion = "valor de corriente por debajo de limite inferior";
        }
    }
    else{
        count_corriente++;
        msg.payload.corriente.alarma = false;
    }
}
// Si todo vuelve a la normalidad, reset alarma habilitada,
// señal de alarma y contadores
else{
    count_corriente = 0;
    arr[eje-1].corriente.color = "green";
    msg.payload.corriente.alarma = false;
    alarma_corriente_habilitada = false;
    flow.set("alarma_corriente_habilitada_"+robot+"_"+eje,alarma_corriente_habilitada);
}
flow.set("delay_alarma_corriente_"+robot+"_"+eje,count_corriente);
flow.set("robot_"+robot,arr);
return msg;

